Sun Odyssey 36i : new sailboat 2007
&#10;
&#10;The Sun Odyssey 36i is the new high-performance cruising yacht built for comfort and designed for those looking for a relaxed way of getting away from it all. Its cutting-edge Sun Odyssey family design give it the personality of a real blue-water boat, whilst its technical fittings are unequalled, and include top brands such as Harken for properly-sized deck fittings and Selden for top-class spars. Two below-deck layouts are offered, both using very high quality materials.
